import React from 'react'
import background from '../layout/background.jpeg'
import ekko from '../layout/ekko.png'
const Portfolio = () => {
    return (
        <div className ="grid-2 bg-dark">
            <div className="portfolio">
                <img        
                    src={background}
                    style={{width: '600px', margin: 'auto', display: 'flex'}}
                    alt ="ContactKeeper"
                />
                <div className="subtitle">Contact Keeper</div>
            </div>

            <img
                className ="portfolio"
                src={ekko}
                style={{width: '600px', margin: 'auto', display: 'flex'}}
                alt = 'Piece 2'
            />
        </div>  
    )
}

export default Portfolio
